eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = ({\n    title: \"Core components\",\n    description: \"Components are the main building blocks for user interfaces. Building a reusable component library enhances your product development workflow by reducing design and tech debt and speeding up the process. Core components can’t be broken down into granular pieces without losing their meaning.\",\n    sections: {\n        \"c-accordion\": {\n            title: \"Accordion\",\n            description: \"Accordion toggles the visibility of content regions when the trigger element gets pressed.\",\n            checklist: {\n                \"c-accordion-active\": {\n                    title: \"Active state\",\n                    description: \"Accordion comes in two states for toggling its content visibility. If an accordion trigger displays an icon, it should be visually distinct between states.\"\n                },\n                \"c-accordion-composition\": {\n                    title: \"Composition\",\n                    description: \"Content area should be flexible enough to support various types of content, including other components.\"\n                },\n                \"c-accordion-transition\": {\n                    title: \"Toggle transition\",\n                    description: \"Add a subtle animation to help users understand and follow the component behavior when switching between states.\"\n                },\n                \"c-accordion-a11y-relation\": {\n                    title: \"Content and trigger relation\",\n                    description: \"Focusing the content area with assistive technologies should announce additional context from the trigger element.\"\n                }\n            }\n        },\n        \"c-alert\": {\n            title: \"Alert\",\n            description: \"Alert displays a prominent message about the whole page or its specific area.\",\n            checklist: {\n                \"c-alert-colors\": {\n                    title: \"Colors\",\n                    description: \"It's crucial to differentiate the alert's visual appearance based on its role. If you're using background colors for role differentiation, ensure there's enough contrast ratio with the content displayed inside the alert.\"\n                },\n                \"c-alert-title\": {\n                    title: \"Title support\",\n                    description: \"Supporting a title can help your user understand the context of the message faster for longer alert messages.\"\n                },\n                \"c-alert-icon\": {\n                    title: \"Icon support\",\n                    description: \"Icon illustrates the role of the alert and provides an additional hint about it for colorblind people.\"\n                },\n                \"c-alert-actions\": {\n                    title: \"Supplementary actions\",\n                    description: \"Actions in the alert should relate to their text and provide a way to react to the message sent to the user.\"\n                },\n                \"c-alert-responsive\": {\n                    title: \"Responsiveness\",\n                    description: \"Alert can adapt to the viewport size, usually becoming full-width for mobile to save some space.\"\n                },\n                \"c-alert-a11y-roles\": {\n                    title: \"Accessibility roles\",\n                    description: \"When using assistive technologies, alerts should announce their accessibility role correctly.\"\n                }\n            }\n        },\n        \"c-avatar\": {\n            title: \"Avatar\",\n            description: \"Thumbnail of a user photo, organization, or a visual representation of other types of content.\",\n            checklist: {\n                \"c-avatar-image\": {\n                    title: \"Image\",\n                    description: \"Avatars should mask an image into their shape and work with any image size since they may get this image from unknown data sources.\"\n                },\n                \"c-avatar-image-fallback\": {\n                    title: \"Image fallback\",\n                    description: \"When not passing an image or there is an image loading error, avatars should be able to show a fallback with a different image, icon, or text initials.\"\n                },\n                \"c-avatar-sizes\": {\n                    title: \"Sizes\",\n                    description: \"There are many contexts to use an avatar, which require different sizes for the component. Use at least 2-3 different sizes for average projects and ensure there’s at least a small size available.\"\n                },\n                \"c-avatar-colors\": {\n                    title: \"Colors\",\n                    description: \"A background color should be applied to the avatar shape when used without an image. Make sure that icons and text have enough contrast ratio with the background according to the WCAG AA standard.\"\n                },\n                \"c-avatar-shape\": {\n                    title: \"Shape\",\n                    description: \"Avatars might support multiple shapes, like square or circle, based on the area they are used in.\"\n                },\n                \"c-avatar-group\": {\n                    title: \"Avatar groups\",\n                    description: \"Multiple avatars can be stacked together to represent a group of users.\"\n                },\n                \"c-avatar-a11y-label\": {\n                    title: \"Accessibility label\",\n                    description: \"Avatar should provide an accessibility label when used for non-decorative images and has no text representation of its contents.\"\n                }\n            }\n        },\n        \"c-badge\": {\n            title: \"Badge\",\n            description: \"Compact element that represents the status of an object or user input.\",\n            checklist: {\n                \"c-badge-colors\": {\n                    title: \"Colors\",\n                    description: \"Badges may play various roles in your product, and having a predefined color for each role should help users understand their meaning. When changing colors, make sure the text has enough contrast ratio with the background according to the WCAG AA standard.\"\n                },\n                \"c-badge-variants\": {\n                    title: \"Variants\",\n                    description: \"Based on where in the product badges are rendered, you might support multiple component variants. For example, you can have some badges using a faded background to avoid drawing too much attention.\"\n                },\n                \"c-badge-sizes\": {\n                    title: \"Sizes\",\n                    description: \"Badges can come in multiple sizes depending on where a badge is used. For example, you can use the large size for marketing pages.\"\n                },\n                \"c-badge-icon-support\": {\n                    title: \"Icon support\",\n                    description: \"To better illustrate the meaning of a badge, you can display an icon next to the text. Make sure that for small badges, icon contents are still recognizable.\"\n                },\n                \"c-badge-dismiss\": {\n                    title: \"Dismissible action\",\n                    description: \"Badges can be used as a dynamic way to display selected values, and there should be a way to dismiss them.\"\n                },\n                \"c-badge-empty\": {\n                    title: \"Empty state\",\n                    description: \"Badges can be used without any text content inside. That usually requires changing their styles to preserve the correct shape.\"\n                },\n                \"c-badge-positioning\": {\n                    title: \"Positioning\",\n                    description: \"When used as a status badge, like a notification indicator – you should be able to position it relative to those elements.\"\n                }\n            }\n        },\n        \"c-button\": {\n            title: \"Button\",\n            description: \"Interactive element used for single-step actions.\",\n            checklist: {\n                \"c-button-colors\": {\n                    title: \"Colors\",\n                    description: \"Buttons may play various roles in your product, and having a predefined color for each role should help users understand their meaning. When changing colors, make sure the text has enough contrast ratio with the background according to the WCAG AA standard.\"\n                },\n                \"c-button-variants\": {\n                    title: \"Variants\",\n                    description: \"When using multiple buttons, there should be a way to differentiate between primary and secondary actions. Buttons may play different roles for the user or be used on various surfaces, and they have to change how they look.\"\n                },\n                \"c-button-sizes\": {\n                    title: \"Sizes\",\n                    description: \"Depending on where a button will be used, it can come in multiple sizes. For example, you can use the small size for dense areas of your application.\"\n                },\n                \"c-button-icon\": {\n                    title: \"Icon support\",\n                    description: \"Icons easily communicate the button's purpose when used next to its label or can be used without text when there's insufficient space. Ensure the accessibility label is provided when used with an icon only.\"\n                },\n                \"c-button-hover\": {\n                    title: \"Hover state\",\n                    description: \"Clearly show that the button is interactive when hovered with a mouse cursor.\"\n                },\n                \"c-button-active\": {\n                    title: \"Active state\",\n                    description: \"Provide a visual cue when a button is pressed, used for selecting a value, or toggles other elements on the page.\"\n                },\n                \"c-button-loading\": {\n                    title: \"Loading state\",\n                    description: \"Indicate when users have to wait for the result of their action after pressing a button. If a spinner is used to display this state, ensure it’s not changing the original button width or height.\"\n                },\n                \"c-button-disabled\": {\n                    title: \"Disabled state\",\n                    description: \"Visually shows that the button is not interactive and restricts it from being pressed.\"\n                },\n                \"c-button-a11y-role\": {\n                    title: \"Accessibility role\",\n                    description: \"Button should correctly announce the button or link accessibility roles and automatically resolve it based on the properties passed to it.\"\n                },\n                \"c-button-a11y-focus\": {\n                    title: \"Focus indicator\",\n                    description: \"Button should have a visible focus indicator when it’s focused using the keyboard or assistive technologies.\"\n                }\n            }\n        },\n        \"c-breadcrumbs\": {\n            title: \"Breadcrumbs\",\n            description: \"Top-level product navigation that helps user understand the location of the current page and navigate back to its parents.\",\n            checklist: {\n                \"c-breadcrumbs-icon\": {\n                    title: \"Icon support\",\n                    description: \"Icons help to communicate the roles of the pages to which breadcrumbs items link. Most of the time, you want to ensure they’re used consistently, not only for random items in the list.\"\n                },\n                \"c-breadcrumbs-disabled\": {\n                    title: \"Disabled state\",\n                    description: \"Each item in the list can be disabled separately to prevent users from navigating to the page.\"\n                },\n                \"c-breadcrumbs-collapsed\": {\n                    title: \"Collapsed state\",\n                    description: \"If breadcrumbs items don’t fit into the parent container, the list should support collapsing items only to keep the relevant ones visible to the user.\"\n                },\n                \"c-breadcrumbs-separator\": {\n                    title: \"Custom separator\",\n                    description: \"Depending on the usage context, items in the breadcrumbs list can use different separator styles.\"\n                }\n            }\n        },\n        \"c-calendar\": {\n            title: \"Calendar\",\n            description: \"Grid displaying days in one or more months and allow users to select a single date or a date range\",\n            checklist: {\n                \"c-calendar-modes\": {\n                    title: \"Display modes\",\n                    description: \"Calendar might be used in various product areas and viewports. Make sure to support different display modes for rendering more than one month or a vertical layout.\"\n                },\n                \"c-calendar-selected\": {\n                    title: \"Selected state\",\n                    description: \"Calendar should support a single date and a selection range. Selected dates should be visually highlighted, and the range between selected dates should be visible to the users.\"\n                },\n                \"c-calendar-month-selection\": {\n                    title: \"Month selection\",\n                    description: \"To help users navigate longer date ranges, the calendar should provide an easy way to switch displayed months.\"\n                },\n                \"c-calendar-day-names\": {\n                    title: \"Day names\",\n                    description: \"Provide short labels for the weekday names in addition to the date numbers to let users easier navigate the date selection.\"\n                },\n                \"c-calendar-i18n\": {\n                    title: \"Internationalisation\",\n                    description: \"Calendars should be localized for all country regions supported by the product. That includes date formats and correct ordering of the weekdays.\"\n                },\n                \"c-calendar-a11y-keyboard\": {\n                    title: \"Keyboard navigation\",\n                    description: \"Calendar dates should be focusable with keyboard and assistive technologies. Further navigation on the dates should happen with keyboard arrows or screen reader navigation and support switching the month by navigating out of a column or a row.\"\n                },\n                \"c-calendar-a11y-state\": {\n                    title: \"State announcement\",\n                    description: \"Selected dates should be announced by the assistive technologies when they get focused.\"\n                }\n            }\n        },\n        \"c-card\": {\n            title: \"Card\",\n            description: \"Container to group information about subjects and their related actions.\",\n            checklist: {\n                \"c-card-composition\": {\n                    title: \"Content composition\",\n                    description: \"Content area should be flexible enough to support various types of content, including other components.\"\n                },\n                \"c-card-media-sections\": {\n                    title: \"Media sections\",\n                    description: \"Cards are frequently used with media content. The most popular options are having a full-width area on top of the content or an area at one of the card’s sides.\"\n                },\n                \"c-card-actions\": {\n                    title: \"Supplementary actions\",\n                    description: \"Cards can be used with actions usually placed at the bottom of the card, or the card itself can be tappable and represent an action.\"\n                },\n                \"c-card-responsive\": {\n                    title: \"Responsiveness\",\n                    description: \"On mobile viewports, cards are usually full-width to save space for the content.\"\n                },\n                \"c-card-groups\": {\n                    title: \"Card groups\",\n                    description: \"Multiple cards can be grouped in a single list of content sections.\"\n                }\n            }\n        },\n        \"c-carousel\": {\n            title: \"Carousel\",\n            description: \"Horizontal scrollable areas used for displaying grouped content.\",\n            checklist: {\n                \"c-carousel-navigation\": {\n                    title: \"Navigation controls\",\n                    description: \"Carousels should be accessible for navigating its content on devices that work with the mouse instead of touch events.\"\n                },\n                \"c-carousel-composition\": {\n                    title: \"Item composition\",\n                    description: \"Content area of the carousel items should be flexible enough to support various types of content, including other components.\"\n                },\n                \"c-carousel-item-size\": {\n                    title: \"Item sizes\",\n                    description: \"Layout of the items should be flexible to support different types of content. For mobile devices, make sure to show a part of the carousel item that doesn’t fit into the viewport to indicate the scrollable area.\"\n                },\n                \"c-carousel-touch\": {\n                    title: \"Touch navigation\",\n                    description: \"Carousel content should be rendered inside a scrollable area to support touch events.\"\n                },\n                \"c-carousel-responsive\": {\n                    title: \"Responsiveness\",\n                    description: \"Carousel items layout might require adjustments based on the available space.\"\n                },\n                \"c-carousel-a11y-keyboard-navigation\": {\n                    title: \"Keyboard navigation\",\n                    description: \"Keyboard and assistive technologies users should be able to navigate the carousel content without clicking on the navigation controls.\"\n                }\n            }\n        },\n        \"c-checkbox\": {\n            title: \"Checkbox\",\n            description: \"Form field used to select one or multiple values from the list.\",\n            checklist: {\n                \"c-checkbox-label\": {\n                    title: \"Label\",\n                    description: \"There should be a text label linked with the checkbox field. Clicking the label should also trigger the checkbox selection. If the label is not rendered on the page, assistive technologies should still announce it.\"\n                },\n                \"c-checkbox-checked\": {\n                    title: \"Checked state\",\n                    description: \"Display when the checkbox gets selected and is used for the form submission.\"\n                },\n                \"c-checkbox-error\": {\n                    title: \"Error state\",\n                    description: \"Use an error state for form validation when the error is related to the checkbox field. Always use a text error along with a different field color.\"\n                },\n                \"c-checkbox-disabled\": {\n                    title: \"Disabled state\",\n                    description: \"Use a disabled state to prevent checkbox interactions and remove its value from the submitted form values.\"\n                },\n                \"c-checkbox-indeterminate\": {\n                    title: \"Indeterminate state\",\n                    description: \"Visually display when the checkbox has children selectable elements and only some are selected.\"\n                },\n                \"c-checkbox-group\": {\n                    title: \"Checkbox group\",\n                    description: \"Checkboxes can be grouped to work with multiple values at the same time.\"\n                },\n                \"c-checkbox-a11y-keyboard\": {\n                    title: \"Keyboard support\",\n                    description: \"Checkbox selections should be triggered with the keyboard. Using native elements for this should provide this kind of interaction automatically.\"\n                }\n            }\n        },\n        \"c-divider\": {\n            title: \"Divider\",\n            description: \"Element for visual content separation\",\n            checklist: {\n                \"c-divider-direction\": {\n                    title: \"Direction\",\n                    description: \"Dividers should separate both horizontal and vertical lists of content.\"\n                },\n                \"c-divider-a11y-role\": {\n                    title: \"Accessibility role\",\n                    description: \"If the divider is playing a non-decorative role in the layout, its role should be announced by the assistive technologies.\"\n                }\n            }\n        },\n        \"c-dropdown\": {\n            title: \"Dropdown\",\n            description: \"List of contextual actions that users can trigger.\",\n            checklist: {\n                \"c-dropdown-composition\": {\n                    title: \"Content composition\",\n                    description: \"Dropdowns may be used for context menus, product navigation, and other purposes. Their content area should be flexible enough to support various types of content, including other components.\"\n                },\n                \"c-dropdown-hover\": {\n                    title: \"Hover trigger\",\n                    description: \"Dropdown should support displaying its content on hover events. The same behavior should happen for keyboard users once its trigger gets focused.\"\n                },\n                \"c-dropdown-positioning\": {\n                    title: \"Dynamic positioning\",\n                    description: \"Dropdown content should be displayed based on the current position of the trigger element on the screen and always stay visible to the user.\"\n                },\n                \"c-dropdown-responsive\": {\n                    title: \"Responsiveness\",\n                    description: \"Dropdown content should be adjusted if it doesn’t fit the screen the same way on mobile devices as on desktop.\"\n                },\n                \"c-dropdown-a11y-focus\": {\n                    title: \"Focus trapping\",\n                    description: \"Once dropdown content is opened, the focus ring should move inside its content area and return to the trigger element when closed.\"\n                },\n                \"c-dropdown-a11y-keyboard\": {\n                    title: \"Keyboard navigation\",\n                    description: \"Dropdown should be accessible for keyboard and assistive technologies. Users should be able to close the dropdown using a separate close action, or once they tab outside the content area.\"\n                }\n            }\n        },\n        \"c-icon\": {\n            title: \"Icon\",\n            description: \"Wrapper for SVG assets to control their appearance\",\n            checklist: {\n                \"c-icon-colors\": {\n                    title: \"Colors\",\n                    description: \"Icons should support color values available in design system tokens. Additionally, it’s a good practice to support color inheritance from their parent element.\"\n                },\n                \"c-icon-sizes\": {\n                    title: \"Sizes\",\n                    description: \"Icons should have several predefined sizes to provide a holistic experience across the product. Typography pairings may be used for these size values to ensure they align with the text sizes.\"\n                },\n                \"c-icon-a11y-decoration\": {\n                    title: \"Interactivity\",\n                    description: \"Icons are used as decorative elements most of the time. If an icon is meant to be interactive – that functionality should be included using buttons, links, or other interactive components.\"\n                }\n            }\n        },\n        \"c-image\": {\n            title: \"Image\",\n            description: \"Utility for displaying images and controlling their behavior.\",\n            checklist: {\n                \"c-image-sizes\": {\n                    title: \"Sizes\",\n                    description: \"Image should be flexible in terms of supported sizes. Besides just supporting width and height – add support for aspect ratio to scale its proportions based on the parent element dynamically.\"\n                },\n                \"c-image-fallback\": {\n                    title: \"Image fallback\",\n                    description: \"Display a fallback when the image URL is incorrect or undefined. That can be an empty box with a background, an icon, or a static placeholder image.\"\n                },\n                \"c-image-density\": {\n                    title: \"Screen density support\",\n                    description: \"Depending on the screen density, you should support loading multiple image assets of different sizes and serve the relevant one to the user.\"\n                },\n                \"c-image-a11y-alt\": {\n                    title: \"Alt text\",\n                    description: \"When the image is non-decorative, it should provide an alt text describing the picture contents.\"\n                }\n            }\n        },\n        \"c-link\": {\n            title: \"Link\",\n            description: \"Interactive text element used for navigation within the text paragraphs.\",\n            checklist: {\n                \"c-link-icon\": {\n                    title: \"Icon support\",\n                    description: \"An icon can be used next to the link to communicate the purpose of the link. Icons shouldn’t be used inside a link without a text label.\"\n                },\n                \"c-link-colors\": {\n                    title: \"Colors\",\n                    description: \"Links may play various roles in your product, and having a predefined color for each role should help users understand their meaning. Since the link is a text element, it should be able to automatically inherit the color defined by its parent element, the same as other text content.\"\n                },\n                \"c-link-disabled\": {\n                    title: \"Disabled state\",\n                    description: \"Visually shows that the link is not interactive and restricts it from being pressed.\"\n                },\n                \"c-link-font-inheritance\": {\n                    title: \"Font inheritance\",\n                    description: \"Links should be able to inherit the typography styles when used as a part of the text element.\"\n                },\n                \"c-link-multiline\": {\n                    title: \"Multiline display\",\n                    description: \"When used inside a text paragraph, links should support multiline display without breaking the text flow.\"\n                },\n                \"c-link-a11y-role\": {\n                    title: \"Accessibility role\",\n                    description: \"Links should correctly announce the button or link accessibility roles automatically resolve it based on the properties passed to it.\"\n                }\n            }\n        },\n        \"c-list\": {\n            title: \"List\",\n            description: \"List is used to display a list of items.\",\n            checklist: {\n                \"c-list-order\": {\n                    title: \"Order\",\n                    description: \"List items can use bulleted, numbered, and other styles and types of ordering.\"\n                },\n                \"c-list-composition\": {\n                    title: \"Content cmposition\",\n                    description: \"List item content areas should be flexible enough to support various types of content, including other components.\"\n                },\n                \"c-list-a11y-role\": {\n                    title: \"Accessibility role\",\n                    description: \"Assistive technologies should announce lists with the correct role and number of items displayed.\"\n                }\n            }\n        },\n        \"c-loading-indicator\": {\n            title: \"Loading indicator\",\n            description: \"Animated element that communicates progress without telling how long the process will take.\",\n            checklist: {\n                \"c-loading-indicator-colors\": {\n                    title: \"Colors\",\n                    description: \"Loading indicators might be used inside the elements with various roles and follow their color scheme.\"\n                },\n                \"c-loading-indicators-sizes\": {\n                    title: \"Sizes\",\n                    description: \"Loading indicators might provide multiple sizes, depending on the size of the areas where the loading indicator is rendered.\"\n                },\n                \"c-loading-indicator-time\": {\n                    title: \"Loading duration\",\n                    description: \"In some cases, the wait time can’t be determined. The loading indicator should be shown until the loading finishes or an error happens. In other cases, it’s better to indicate the time left until the loading is finished.\"\n                },\n                \"c-loading-indicator-a11y-reduced-motion\": {\n                    title: \"Reduced motion\",\n                    description: \"The loading indicator should be synced with the system motion settings and reduce its animation speed when reduced motion settings are turned on.\"\n                },\n                \"c-loading-indicator-a11y-label\": {\n                    title: \"Accessibility label\",\n                    description: \"If the loading indicator is standalone – provide an accessibility label for the content area it’s loading.\"\n                }\n            }\n        },\n        \"c-modal\": {\n            title: \"Modal\",\n            description: \"Container appearing in front of the main content to provide critical information or an actionable piece of content.\",\n            checklist: {\n                \"c-modal-composition\": {\n                    title: \"Content composition\",\n                    description: \"The main content area should be flexible enough to support various types of content, including other components.\"\n                },\n                \"c-modal-actions\": {\n                    title: \"Supplementary actions\",\n                    description: \"Since content in the modal may be actionable, it’s essential to have an area for action elements. This area is usually located at the bottom of the modal container.\"\n                },\n                \"c-modal-close\": {\n                    title: \"Close action\",\n                    description: \"Modals should provide a straightforward way to close, as they block content when open. This may be either a separate close button or one of the supplementary actions.\"\n                },\n                \"c-modal-positioning\": {\n                    title: \"Positioning\",\n                    description: \"Modals can be positioned in the center of the screen or displayed as sliding sheets on either side of the screen.\"\n                },\n                \"c-modal-sizes\": {\n                    title: \"Sizes\",\n                    description: \"Provide support for changing the modal height and width based on the content you display.\"\n                },\n                \"c-modal-a11y-focus\": {\n                    title: \"Focus trapping\",\n                    description: \"When the modal gets opened, the user focus should move to the first focusable element and stay trapped inside it. When the modal is closed, the focus should return to the last active element.\"\n                },\n                \"c-modal-a11y-keyboard\": {\n                    title: \"Keyboard navigation\",\n                    description: \"It should be possible to close a modal by pressing the Esc key, and all the focusable elements inside the modal container should be accessible with keyboard navigation.\"\n                },\n                \"c-modal-a11y-labels\": {\n                    title: \"Title and subtitle labeling\",\n                    description: \"Modals should use the correct accessibility role, and they should be labeled by the title and subtitle elements. If there is no visible title or subtitle, it may use an accessibility label instead.\"\n                }\n            }\n        },\n        \"c-pagination\": {\n            title: \"Pagination\",\n            description: \"Pagination enables a selection from a range of pages\",\n            checklist: {\n                \"c-pagination-selected\": {\n                    title: \"Selected page state\",\n                    description: \"Visually highlight the selected page in the list and make it non-interactive.\"\n                },\n                \"c-pagination-ranges\": {\n                    title: \"Page display ranges\",\n                    description: \"Define the ranges for pages rendered around the selected page. It helps render only a limited number of pages but lets the users navigate faster than moving by 1 page at a time.\"\n                },\n                \"c-pagination-amount\": {\n                    title: \"Amount of items per page\",\n                    description: \"Provide an option to select the number of paginated items displayed on the page.\"\n                },\n                \"c-pagination-indeterminate\": {\n                    title: \"Indeterminate amount of pages\",\n                    description: \"When you don’t know the total number of available pages beforehand, use a different display mode to navigate pages individually.\"\n                },\n                \"c-pagination-a11y-label\": {\n                    title: \"Full page label announcements\",\n                    description: \"Pagination should provide clear, dynamic labels for each page for assistive technologies instead of just announcing the number without context.\"\n                },\n                \"c-pagination-a11y-state\": {\n                    title: \"State announcement\",\n                    description: \"Pagination should announce when a selected page is focused.\"\n                }\n            }\n        },\n        \"c-progress\": {\n            title: \"Progress bar\",\n            description: \"Bar displaying progress for a task that takes a long time or consists of several steps.\",\n            checklist: {\n                \"c-progress-label\": {\n                    title: \"Label\",\n                    description: \"Provide support for visually displaying a label explaining what a progress bar is responsible for.\"\n                },\n                \"c-progress-sizes\": {\n                    title: \"Sizes\",\n                    description: \"Loading indicators might provide multiple sizes, depending on the size of the areas where the loading indicator is rendered.\"\n                },\n                \"c-progress-duration\": {\n                    title: \"Duration\",\n                    description: \"In some cases, the wait time can’t be determined. The loading indicator should be shown until the loading finishes or an error happens. In other cases, it’s better to indicate the time left until the loading is complete.\"\n                },\n                \"c-progress-a11y-label\": {\n                    title: \"Accessibility label\",\n                    description: \"Provide support for adding an accessibility label in case you can’t display a label in the interface.\"\n                }\n            }\n        },\n        \"c-radio\": {\n            title: \"Input radio\",\n            description: \"Radio is a form element used for selecting one option from a list.\",\n            checklist: {\n                \"c-radio-label\": {\n                    title: \"Label\",\n                    description: \"There should be a text label linked with the radio field. Clicking the label should also trigger the checkbox selection. If the label is not rendered on the page, assistive technologies should still announce it.\"\n                },\n                \"c-radio-checked\": {\n                    title: \"Checked state\",\n                    description: \"Display when the radio gets selected and is used for the form submission.\"\n                },\n                \"c-radio-error\": {\n                    title: \"Error state\",\n                    description: \"Use an error state for form validation when the error is related to the radio field. Always use a text error along with a different field color.\"\n                },\n                \"c-radio-disabled\": {\n                    title: \"Disabled state\",\n                    description: \"Use a disabled state to prevent radio interactions and remove its value from the submitted form values.\"\n                },\n                \"c-radio-group\": {\n                    title: \"Radio group\",\n                    description: \"Radio buttons are always used as a group to avoid locking the selection after one of the radio buttons is checked.\"\n                },\n                \"c-radio-a11y-keyboard\": {\n                    title: \"Keyboard support\",\n                    description: \"Radio selection should be triggered with the keyboard. Using native elements for this should provide this kind of interaction automatically.\"\n                }\n            }\n        },\n        \"c-select\": {\n            title: \"Select\",\n            description: \"Select lets you choose a single value from a list of options.\",\n            checklist: {\n                \"c-select-label\": {\n                    title: \"Label\",\n                    description: \"Text labels linked with the Select field can provide users with additional context. Clicking the label should also trigger the select dropdown.\"\n                },\n                \"c-select-error\": {\n                    title: \"Error state\",\n                    description: \"Use an error state for form validation when the error is related to the select only. Display an additional error icon for better accessibility.\"\n                },\n                \"c-select-disabled\": {\n                    title: \"Disabled state\",\n                    description: \"Use the disabled state to prevent Select interactions and remove its value from the submitted form values.\"\n                },\n                \"c-select-placeholder\": {\n                    title: \"Placeholder\",\n                    description: \"When no value is selected – display a placeholder value. You can use the same placeholder value to let users reset the select value back to the default.\"\n                },\n                \"c-select-helper\": {\n                    title: \"Helper text\",\n                    description: \"Provide users with additional context about the select purpose and the requirements for the selection.\"\n                },\n                \"c-select-icon\": {\n                    title: \"Icon support\",\n                    description: \"Add an area for displaying an icon at the start of the field to communicate the purpose of the Select as a component or the selected value.\"\n                },\n                \"c-select-prefix\": {\n                    title: \"Prefix\",\n                    description: \"Add an area for custom content to make the selection more contextual for the user. For example, you can display country flags in your country code selection.\"\n                },\n                \"c-select-sizes\": {\n                    title: \"Sizes\",\n                    description: \"Depending on where select is going to be used, it can come in multiple sizes. For example, you can use the small size for dense areas of your application.\"\n                },\n                \"c-select-a11y-label\": {\n                    title: \"Accessibility label\",\n                    description: \"In case you don’t provide a visual text label for select, make sure to provide an accessibility label still describing the purpose of the component.\"\n                }\n            }\n        },\n        \"c-skeleton\": {\n            title: \"Skeleton\",\n            description: \"Placeholder replacing page elements while their data is loading.\",\n            checklist: {\n                \"c-skeleton-sizes\": {\n                    title: \"Sizes\",\n                    description: \"Skeleton should be able to match components of various sizes available in your design system to avoid unnecessary layout shifts once data is loaded.\"\n                },\n                \"c-skeleton-shapes\": {\n                    title: \"Shapes\",\n                    description: \"Skeleton should be able to match components of various shapes available in your design system to keep the loading state aligned with the actual components' layout.\"\n                },\n                \"c-skeleton-composition\": {\n                    title: \"Composition\",\n                    description: \"You can compose simple skeletons into more advanced layouts. You don’t have to 1:1 map your application interface with skeletons.\"\n                },\n                \"c-skeleton-a11y-motion\": {\n                    title: \"Reduced motion\",\n                    description: \"Reduce or altogether remove the animation for the reduced motion user preference.\"\n                }\n            }\n        },\n        \"c-switch\": {\n            title: \"Switch\",\n            description: \"Toggle for immediately changing the state of a single item.\",\n            checklist: {\n                \"c-switch-label\": {\n                    title: \"Label\",\n                    description: \"There should be a text label linked with the switch. Clicking the label should also trigger the switch selection. If the label is not rendered on the page, assistive technologies should still announce it.\"\n                },\n                \"c-switch-checked\": {\n                    title: \"Checked state\",\n                    description: \"Display when the switch gets selected and activates the underlying functionality. Often, a switch is used to immediately update the data after it’s selected.\"\n                },\n                \"c-switch-disabled\": {\n                    title: \"Disabled state\",\n                    description: \"Use a disabled state to prevent switch interactions.\"\n                },\n                \"c-switch-a11y-keyboard\": {\n                    title: \"Keyboard navigation\",\n                    description: \"Switch selection should be triggered with the keyboard. Using native elements for this should provide this kind of interaction automatically.\"\n                },\n                \"c-switch-a11y-label\": {\n                    title: \"Accessibility label\",\n                    description: \"In case you don’t provide a visual text label for Switch, make sure to provide an accessibility label still describing the purpose of the component.\"\n                }\n            }\n        },\n        \"c-tabs\": {\n            title: \"Tabs\",\n            description: \"Navigation between multiple pages or content sections.\",\n            checklist: {\n                \"c-tabs-composition\": {\n                    title: \"Content composition\",\n                    description: \"Content area should be flexible enough to support various types of content, including other components.\"\n                },\n                \"c-tabs-variants\": {\n                    title: \"Variants\",\n                    description: \"To support different rendering contexts, tabs might support multiple variants. For example, they might be rendered as pills when used directly on the page while using an underlined variant for tabs rendered inside cards.\"\n                },\n                \"c-tabs-selected\": {\n                    title: \"Selected state\",\n                    description: \"Since tabs always display the content from one of their panels, one of the tab triggers should always be selected and highlighted visually.\"\n                },\n                \"c-tabs-disabled\": {\n                    title: \"Disabled state\",\n                    description: \"Tab triggers can be disabled to prevent users from switching to a specific tab panel.\"\n                },\n                \"c-tabs-icon\": {\n                    title: \"Icon support\",\n                    description: \"To better illustrate the meaning of each tab, you can display an icon next to the tab trigger text.\"\n                },\n                \"c-tabs-equal\": {\n                    title: \"Equal width layout\",\n                    description: \"When used to take the entire width of the parent container, tab triggers can be stretched to take equal horizontal space.\"\n                },\n                \"c-tabs-a11y-keyboard\": {\n                    title: \"Keyboard support\",\n                    description: \"When interacting with tabs using the keyboard, they should support arrow navigation to switch between the previous and next panels. The Home and End buttons should also move the selection to the first and last panels, respectively.\"\n                }\n            }\n        },\n        \"c-text-area\": {\n            title: \"Text area\",\n            description: \"Form field to enter and edit multiline text.\",\n            checklist: {\n                \"c-text-area-label\": {\n                    title: \"Label\",\n                    description: \"Text labels linked with the text area can provide users with additional context. Clicking the label should move the focus to the field.\"\n                },\n                \"c-text-area-error\": {\n                    title: \"Error state\",\n                    description: \"Use an error state for form validation when the error is related only to the Text area.\"\n                },\n                \"c-text-area-disabled\": {\n                    title: \"Disabled state\",\n                    description: \"Use a disabled state to prevent text area interactions and remove its value from the submitted form values.\"\n                },\n                \"c-text-area-placeholder\": {\n                    title: \"Placeholder\",\n                    description: \"When the text area value is empty – display a placeholder value. Make sure that it’s not used instead of the label.\"\n                },\n                \"c-text-area-helper\": {\n                    title: \"Helper text\",\n                    description: \"Provide users with additional context about the Text area purpose and the requirements for the expected value.\"\n                },\n                \"c-text-area-sizes\": {\n                    title: \"Sizes\",\n                    description: \"Depending on where the text area will be used, it can come in multiple sizes. For example, you can use the large size for the forms on marketing pages.\"\n                },\n                \"c-text-area-a11y-label\": {\n                    title: \"Accessibility label\",\n                    description: \"In case you don’t provide a visual text label for the text area, make sure to provide an accessibility label still describing the purpose of the component.\"\n                }\n            }\n        },\n        \"c-text-field\": {\n            title: \"Text field\",\n            description: \"Form field to enter and edit single-line text.\",\n            checklist: {\n                \"c-text-field-label\": {\n                    title: \"Label\",\n                    description: \"Text labels linked with the text field can provide users with additional context. Clicking the label should move the focus to the field.\"\n                },\n                \"c-text-field-error\": {\n                    title: \"Error state\",\n                    description: \"Use an error state for form validation when the error is related only to the text field.\"\n                },\n                \"c-text-field-disabled\": {\n                    title: \"Disabled state\",\n                    description: \"Use a disabled state to prevent text field interactions and remove its value from the submitted form values.\"\n                },\n                \"c-text-field-placeholder\": {\n                    title: \"Placeholder\",\n                    description: \"When the text field value is empty – display a placeholder value. Make sure that it’s not used instead of the label.\"\n                },\n                \"c-text-field-helper\": {\n                    title: \"Helper text\",\n                    description: \"Provide users with additional context about the text field purpose and the requirements for the expected value.\"\n                },\n                \"c-text-field-icon\": {\n                    title: \"Icon support\",\n                    description: \"Add an area for displaying an icon at the start of the field to communicate the purpose of the text field as a component or the field value.\"\n                },\n                \"c-text-field-affix\": {\n                    title: \"Prefix / Suffix\",\n                    description: \"Add an area for custom content to make the selection more contextual for the user. For example, you can display payment providers in the text field for credit card numbers.\"\n                },\n                \"c-text-field-sizes\": {\n                    title: \"Sizes\",\n                    description: \"Depending on where the text field will be used, it can come in multiple sizes. For example, you can use the large size for the forms on marketing pages.\"\n                },\n                \"c-text-field-a11y-label\": {\n                    title: \"Accessibility label\",\n                    description: \"In case you don’t provide a visual text label for the text field, make sure to provide an accessibility label still describing the purpose of the component.\"\n                }\n            }\n        },\n        \"c-toast\": {\n            title: \"Toast\",\n            description: \"Notification message or a piece of information displayed above the page content.\",\n            checklist: {\n                \"c-toast-composition\": {\n                    title: \"Content composition\",\n                    description: \"Content area should be flexible enough to support various types of content, including other components.\"\n                },\n                \"c-toast-colors\": {\n                    title: \"Colors\",\n                    description: \"Depending on the role of the notification displayed in the toast, it can come in multiple colors. For example, it can be colored red for error notifications.\"\n                },\n                \"c-toast-icon\": {\n                    title: \"Icon support\",\n                    description: \"Add an area for displaying an icon at the start of the toast to communicate the purpose of the notification.\"\n                },\n                \"c-toast-timeout\": {\n                    title: \"Timeout\",\n                    description: \"Toasts are usually dismissed after a timeout. Make sure to provide a long enough timeout to let the users read the message. If there is no timeout – provide a button to close the notification.\"\n                },\n                \"c-toast-stacking\": {\n                    title: \"Stacking\",\n                    description: \"When multiple toasts have been triggered, stack them on top of each other to avoid cluttering the screen.\"\n                },\n                \"c-toast-action\": {\n                    title: \"Supplementary action\",\n                    description: \"Actions in the notifications should be contextual to the notification purpose. For example, if you notify the user about deleting content, an action element can help them undo this operation.\"\n                },\n                \"c-toast-a11y-focus\": {\n                    title: \"Focus management\",\n                    description: \"When toasts have actions, they should be focusable from the keyboard to trigger them. While the focus is inside the toast container – timeout should get disabled.\"\n                },\n                \"c-toast-a11y-motion\": {\n                    title: \"Reduced motion\",\n                    description: \"Reduce or altogether remove the animation for the reduced motion user preference.\"\n                }\n            }\n        },\n        \"c-tooltip\": {\n            title: \"Tooltip\",\n            description: \"Contextual text information display on element hover or focus.\",\n            checklist: {\n                \"c-tooltip-positioning\": {\n                    title: \"Positioning\",\n                    description: \"When the tooltip default position doesn’t let it fit into the viewport – make sure to dynamically switch its position to another value.\"\n                },\n                \"c-tooltip-timeout\": {\n                    title: \"Timeout\",\n                    description: \"Wait briefly before opening the Tooltip to ensure they don’t open while the user moves their cursor around the screen.\"\n                },\n                \"c-tooltip-a11y-keyboard\": {\n                    title: \"Keyboard support\",\n                    description: \"Tooltips should be accessible not only on mouse hover but also on the trigger element focus. \"\n                }\n            }\n        }\n    }\n});\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/translations/en/components.js\n");

