eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = ({\n    heroTitle: \"Build better design systems\",\n    heroSubtitle: \"A checklist to help you plan, build and grow your design system.\",\n    heroAction: \"Get started\",\n    about: \"About\",\n    share: \"Share\",\n    contribute: \"Contribute\",\n    previous: \"Previous\",\n    next: \"Next\",\n    completed: \"Completed\",\n    exportTitle: \"Spread the word\",\n    exportSubtitle: \"Design systems are best built together. This is why it's possible to share this checklist including the items you've already checked. Share your progress with your team so you can all keep track together.\",\n    exportAction: \"Share your progress\",\n    exportComplete: \"Link copied\",\n    footerTitle: \"\",\n    footerText: \"\",\n    footerAction: \"Learn more\"\n});\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/translations/en/core.js\n");

