eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = ({\n    title: \"Design language\",\n    description: \"Like any language, a design language is a methodical way of communicating with your audience through your approach to product design. It’s the cornerstone of consistent customer experiences.\",\n    sections: {\n        \"dl-brand\": {\n            title: \"Brand\",\n            description: \"Brand drives every single decision you make when building new products or features. A good brand is much more than a name and a logo. It’s the values that define your unique identity and what makes you stand out from others.\",\n            checklist: {\n                \"dl-brand-vision\": {\n                    title: \"Vision\",\n                    description: \"Why you exist, what your values are, and how they’ll help guide the future of your product.\"\n                },\n                \"dl-brand-principles\": {\n                    title: \"Design principles\",\n                    description: \"The considerations that guide the basis of your practice. They outline how you approach design philosophically and help with everyday decisions.\"\n                },\n                \"dl-brand-tone\": {\n                    title: \"Tone of voice\",\n                    description: \"A clear tone of voice defines how you speak to your audience at every moment of their journey, helping them get wherever they want to go.\"\n                },\n                \"dl-brand-terminology\": {\n                    title: \"Terminology\",\n                    description: \"Create the standard terms and phrases that need to be kept the same throughout the user experience, speeding up the design process and unifying your voice.\"\n                },\n                \"dl-brand-assets\": {\n                    title: \"Brand assets\",\n                    description: \"Using a consistent set of brand assets aligns the user experience across your product and marketing campaigns. These assets include your logo, fonts, icons, illustrations, etc.\"\n                }\n            }\n        },\n        \"dl-guidelines\": {\n            title: \"Guidelines\",\n            description: \"Understanding how to approach common UX patterns will allow your organization to establish a consistent approach and user experience on any platform.\",\n            checklist: {\n                \"dl-guidelines-a11y\": {\n                    title: \"Accessibility\",\n                    description: \"Guidelines for how you approach accessibility and how you leverage color, hierarchy, and assistive technologies to help your users.\"\n                },\n                \"dl-guidelines-writing\": {\n                    title: \"Writing guidelines\",\n                    description: \"Every consistent experience needs watertight writing. Laying down the foundations for your house style early keeps everything in line with consistent grammar, style choices, and action-oriented language to help your design.\"\n                },\n                \"dl-guidelines-microcopy\": {\n                    title: \"Microcopy guidelines\",\n                    description: \"The standard way to write for the components in your design system. These take platform conventions and best practices for writing all into consideration.\"\n                },\n                \"dl-guidelines-terminology\": {\n                    title: \"Terminology\",\n                    description: \"Create the standard terms and phrases that need to be kept the same throughout the user experience, speeding up the design process and unifying your voice.\"\n                },\n                \"dl-guidelines-i18n\": {\n                    title: \"Internationalisation\",\n                    description: \"Define standards for handling content translated into various languages supported by the product. It includes handling translation edge cases and content bi-directionality.\"\n                }\n            }\n        }\n    }\n});\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/translations/en/designLanguage.js\n");

